// Contact section

.contact-section {
  padding: 100px 20px;
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  text-align: center;
  .contact-div {
    width: 50%;
    display: flex;
    flex-direction: column;
    form {
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;
      label {
        text-transform: uppercase;
        display: block;
        width: 100%;
        font-weight: bold;
        margin: 5px auto;
        letter-spacing: -1px;
        line-height: 20px;
      }
      input {
        width: 100%;
        height: 2.5rem;
        margin-bottom: 10px;
        line-height: 1.6;
        vertical-align: middle;
        border: 1px solid #ccc;
      }
      textarea {
        display: block;
        width: 100%;
        border: 1px solid #ccc;
        height: auto;
        color: #555;
        background-color: #fff;
        overflow: auto;
      }
      .button {
        width: 20%;
        margin: 20px auto;
        text-align: center;
        padding: 0;
        border: 2px solid black;
      }
    }
  }
}

// Footer

.footer-section {
  background-color: #242424;
  margin: 10px;
  padding: 20px;
  height: 300px;
  .footer-div {
    width: 100%;
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    color: white;
    h6 {
      color: #7d7d7d;
      font-size: 14px;
      text-transform: uppercase;
      line-height: 18px;
      letter-spacing: 0;
    }
    .col-1 {
      grid-column: 1;
      img {
        height: 15%;
        width: 15%;
        aspect-ratio: 1 / 1;
        margin-top: 3.5rem;
        margin-left: 3.5rem;
      }
    }
    .col-2 {
      grid-column: 2;
      display: flex;
      flex-direction: column;

      a {
        text-decoration: none;
        color: white;
        cursor: pointer;
        font-size: 15px;
        font-family: $ff-p;
        margin-bottom: 5px;
        letter-spacing: -0.5px;
        line-height: 28px;
      }
    }
    .col-3 {
      p {
        font-size: 15px;
        line-height: 28px;
        letter-spacing: -0.5px;
        font-weight: 400;
        margin-bottom: 5px;
      }
    }
    .col-4 {
      p {
        font-size: 15px;
        line-height: 28px;
        letter-spacing: -0.5px;
        font-weight: 400;
        margin-bottom: 5px;
      }
    }
  }
}
